import React from "react";
import { NavLink, Link } from "react-router-dom";
import { NavContainer,NavUl,NavList } from "../Stylings/NavStylings";
import { useAuth } from "./auth";

const Entry = () => {
    const auth=useAuth()
  return (
    
      <NavContainer>
        <NavUl>
          <NavList><Link to="/landingpage">Landing Page</Link></NavList>
          <NavList><Link to ="/reviews">Protected Review</Link></NavList>
          {/* <NavList><Link to ="/login">Login</Link></NavList> */}
       
        {!auth.user && (<NavList><Link to ="/login">Login</Link></NavList>)}
        </NavUl>
      </NavContainer>
    
  );
};

export default Entry;
